INSERT INTO `capacitacion` (`id_cap`, `titulo_video`, `descripcion`, `imag_portada`, `url_video`, `evaluacion`, `fecha_public`, `orden_visual`) VALUES
(2, '¿Cómo instalar los purificadores Dvigi?', 'Sepa cómo instalar un purificador sobre cubierta DVIGI. Fácil, práctico y rápido. \r\n', 'WhatsApp_Image_2018-10-18_at_3_56_46_PM1.jpeg', 'https://www.youtube.com/watch?v=0ACmPaFKzmI', '', '0000-00-00', 6),
(3, 'Principales beneficios que ofrece DVIGI ', 'Compartimos los principales beneficios de nuestros purificadores de agua DVIGI. La principal diferencia con otros purificadores del mercado. ', 'WhatsApp_Image_2018-10-18_at_4_52_32_PM.jpeg', 'https://www.youtube.com/watch?v=2W50anjbt5w', '', '0000-00-00', 4),
(5, ' ¿Cómo utilizar la Jarra Purificadora Sense de marca Dvigi?', 'En el siguiente vídeo podrá ver lo práctico que es utilizar y mantener un Jarro Sense.  ¿Sabías que su diseño fue galardonado por el Ministerio de Industria de la Nación en Argentina? Premiada con el sello del Buen Diseño. ', 'WhatsApp_Image_2018-10-19_at_9_33_28_AM3.jpeg', 'https://www.youtube.com/watch?v=yeonutc1Ub0', '', '2018-11-26', 7),
(6, ' Concientizacion de la necesidad de tener un Purificador de agua ', 'El agua posee un montón de contaminantes y para eso es importante purificar el agua', 'WhatsApp_Image_2018-11-07_at_3_47_22_PM.jpeg', 'https://www.youtube.com/watch?v=99-J_AhDhNg', '', '0000-00-00', 3),
(7, ' ¿Porque es imprescindible tener un purificador de agua?', 'El agua potable no es sinónimo de agua purificada, la misma posee muchísimo contaminantes que dañan nuestra salud', 'WhatsApp_Image_2018-11-07_at_3_58_25_PM.jpeg', 'https://www.youtube.com/watch?v=ukY0UQricyo', '', '0000-00-00', 2),
(8, ' Modelo de Negocios Emprendedores Dvigi', 'Explicación del modelo de negocios emprendedores DVIGI', 'WhatsApp_Image_2018-11-12_at_11_59_51_AM.jpeg', 'https://www.youtube.com/watch?v=32hW4PfUclk', '', '2018-11-12', 0),
(9, ' ¿Quienes somos?', 'En el siguiente vídeo la Presidenta de la empresa nos contará, quien es Dvigi!', 'WhatsApp_Image_2018-11-12_at_12_43_52.jpeg', 'https://www.youtube.com/watch?v=vxUFj1d4S4Y', '', '2018-11-12', 1),
(12, ' Purificador de ducha', 'En el siguiente video se encuentra el purificador de ducha y todos sus beneficios', 'WhatsApp_Image_2018-11-30_at_1_50_10_PM.jpeg', 'https://www.youtube.com/watch?v=9nqYPCGsV_I', '', '2018-11-30', 11),
(13, ' HydroBot', 'En el siguiente video conoceremos todos los beneficios de la botella Hydrogenadora', 'WhatsApp_Image_2018-11-30_at_1_57_14_PM.jpeg', 'https://www.youtube.com/watch?v=VUVNvwgGYNA', '', '2018-11-30', 13),
(14, ' SodaBot', 'En el siguiente video conoceremos todos los beneficios de la maquina de Soda', 'WhatsApp_Image_2018-11-30_at_2_04_50_PM.jpeg', 'https://www.youtube.com/watch?v=B2sXaxmuWGQ', '', '2018-11-30', 12),
(15, ' Purificador sobre mesada', 'En el siguiente video podremos ver el purificador sobre mesada y todos sus beneficios', 'WhatsApp_Image_2018-11-30_at_2_04_49_PM.jpeg', 'https://www.youtube.com/watch?v=77EBxXsG1SI', '', '2018-11-30', 8),
(16, '   Jarra Sense', 'Purificador portátil modelo Jarra Sense! \r\nIdeal para llevar a todas partes, en vacaciones,  guardar agua purificada en la heladera, llevar a la mesa, y más!\r\nAgua pura en minutos y donde quieras!', 'WhatsApp_Image_2018-11-13_at_14_18_56.jpeg', 'https://www.youtube.com/watch?v=ngknVnldJqs', '', '2018-12-06', 9),
(18, '  Purificador Bajo Mesada', 'Excelente opción para instalar en la cocina sin ocupar espacios!', 'Combo9_tienda.png', 'https://www.youtube.com/watch?v=VLDHGJQKQas', '', '2018-12-06', 10),
(19, ' Video 1: ¿Como sumar patrocinados a tu equipo?', '-', 'WhatsApp_Image_2018-11-13_at_14_17_41.jpeg', 'https://youtu.be/gxBh9xaAP3k', '', '2018-12-13', 15),
(20, ' Video 2: ¿Como sumar patrocinados a mi equipo?', '-', 'WhatsApp_Image_2018-11-13_at_14_17_411.jpeg', 'https://youtu.be/d_ld_RB_3PM', '', '2018-12-13', 16),
(21, ' Dispenser de red', '-', '', 'https://youtu.be/_ksk8_GlDzI', '', '2018-12-17', 14),
(22, ' La importancia del agua purificada al cocinar y lavar alimentos!', '-', 'WhatsApp_Image_2018-11-13_at_09_59_27_(1).jpeg', 'https://youtu.be/WzzOVgoj_dc', '', '2018-12-17', 5),
